from pyVmomi.VmomiSupport import CreateDataType, CreateManagedType, CreateEnumType, AddVersion, AddVersionParent, F_LINK, F_LINKABLE, F_OPTIONAL, F_SECRET

from pyVmomi.VmomiSupport import AddVersion, AddVersionParent
from pyVmomi.VmomiSupport import newestVersions, stableVersions, publicVersions, oldestVersions

def _AddVersionParents(vsanVer, parents):
   for group in parents:
      for parent in group:
         AddVersionParent(vsanVer, parent)

"""
Vmodl version definition for each Vsan release.
Initially Vsan just uses "vim" namespace.
"""

# Vsan Java-IDL based Vmodl, corresponding to vSphere 5.5
_VERSION_9 = "vim.version.version9"

# Vsan version 1 ("vim"), corresponding to vSphere 6.0-6.2
# Vsan switch to pyhon-IDL based Vmodl around vSphere 6.1
_VERSION_10 = "vim.version.version10"

# Vsan version 2 ("vim"), corresponding to vSphere 6.5
_VERSION_11 = "vim.version.version11"


"""
vSphere 6.6, the first release we started to introduce "vsan"
version namespace, which defined as a child version of previous
"vim" versions.

Define a new Vsan vmodl version for each Vsan release below.
"""

# Vsan version 3, corresponding to vSphere 6.6
_VSAN_VER3 = "vsan.version.version3"
_VSAN_VER3_PARENTS = [
      # Note that ending number in a "range" is exclusive.
      ["vsan.version.version%d"          % x for x in [3]],
      ["vmodl.version.version%d"         % x for x in range(3)],
      ["vmodl.reflect.version.version%d" % x for x in range(1, 3)],
      ["vim.version.version%d"           % x for x in range(1, 12)],
      ["vmodl.query.version.version%d"   % x for x in range(1, 5)],
]
AddVersion(_VSAN_VER3, "vsan", "6.6", 0, "vsan")
_AddVersionParents(_VSAN_VER3, _VSAN_VER3_PARENTS)


# Update newest/stable to the latest version
newestVersions.Add(_VSAN_VER3)
stableVersions.Add(_VSAN_VER3)
publicVersions.Add(_VSAN_VER3)

# Capture all vsan versions here
VSAN_VERSIONS = [
      _VSAN_VER3,
]


